Abe Yoshitoshi, as you can see at the link above - which is surely incomplete, has done a vast amount of work in his lifetime. I checked out several of his other artbooks but didn't find any of them nearly as interesting as this one. The &quot;people&quot; in this book genuine look as if they are experiencing emotion to me. Sadness, frustration, confusion, anger. It's not a very long book, but I liked it enough to pass it along to those who have been checking out the various artbooks I've uploaded.
